import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import {increment, decrement, islogged} from './actions';
import Navbar from './components/navbar';

function App() {
  const counter = useSelector(state => state.counter);
  const isLogged = useSelector(state => state.isLogged);
  const dispatch = useDispatch();
  return (
    <div className="App">
      <Navbar/>
      <div className="container">
        <h2>Movies {counter}</h2>
        <button onClick={() => dispatch(increment(1))}>+</button>
        <button onClick={() => dispatch(decrement(1))}>-</button>
        { isLogged ? <div className="menuright"> <button onClick={() => dispatch(decrement(1))}>Log out</button> </div> : <div className="menuright"><button onClick={() => dispatch(decrement(1))}>Log in</button></div> }
      </div>
    </div>
  );
}

export default App;
